export const DAILY_PLANS: Record<string, Record<string, { retention: Lead[] }>> = {};

REPS.forEach(rep => {
    DAILY_PLANS[rep.id] = {
        'Poniedziaek': { retention: ALL_LEADS.filter(l => l.assignedTo === rep.id).slice(0, 3) },
        'Wtorek': { retention: ALL_LEADS.filter(l => l.assignedTo === rep.id).slice(3, 6) },
        'roda': { retention: ALL_LEADS.filter(l => l.assignedTo === rep.id).slice(6, 9) },
        'Czwartek': { retention: ALL_LEADS.filter(l => l.assignedTo === rep.id).slice(9, 12) },
        'Pitek': { retention: ALL_LEADS.filter(l => l.assignedTo === rep.id).slice(12, 15) },
    };
});

export const getDailyPlanForRep = (repId: string, day: string) => {
    return DAILY_PLANS[repId]?.[day] || { retention: [] };
};

export const getLeadById = (id: string) => {
    return ALL_LEADS.find(l => l.id === id);
};

